protected static boolean isValidQueueName(String queueName) {
  if (queueName != null) {
    if (queueName.equals(FairSchedulerUtilities.trimQueueName(queueName)) &&
        !queueName.startsWith(DOT) &&
        !queueName.endsWith(DOT)) {
      return true;
    }
  }
  return false;
}
